import React from "react";
import codeReviewWire from "../../../../public/assets/landing page/wire-code-review.png";

const LPAssets = () => {
  return (
    <div className="absolute bottom-10 z-30 top-8 left-0 flex items-center">
      <img src={codeReviewWire} width={100}/>
      <p className="-translate-y-10">Instant Code Review</p>
    </div>
  );
};

export default LPAssets;
